import React from 'react';

import '../styles/Divider.components.css';

const Divider = () => (
	<div id="Divider">
		<div className="Strikethrough"></div>
		<div className="Divider-Text">OR</div>
		<div className="Strikethrough"></div>
	</div>
);

export default Divider;
